s1+="RETURN.$^1sThis APP is about the first 12 options of the DOTS ACTION. Option 0 is for no option.$^1hThe operation can be within a sub-canvas or in a separate canvas. Click CHANGE to switch type.$^1`FIRST TYPE: Red Hexigon before sub-canvas and Green Star with Option Number after the sub-canvas is made.$^1SSECOND TYPE: Red Hexigon on Canvas 3 and Green Star with Option Number on Canvas 3.$^1jOption 14 is used to make a one use sub-canvas. Multiple uses start with option 15 and end with option 16.$^1SSelect the option you want by clicking the number in the brown box. Click RETURN to stop the APP.$^1 PATL uses an 8 digit number to control a lines movement.  First 2 digits 00: Straight Line$^1cFIRST DIGIT: 1 Curve Out Clockwise$^1E5 Wave Curve Out Clockwise$^1GLAST 6 DIGITS: DDCCSS$^1g2 Curve Out Counterckw$^1D6 Wave Curve Out Counterckw$^1IDD Direction  00 TO 23$^1ZROWS$^1B3 Curve In  Clockwise$^1E7 Wave Curve In  Clockwise$^1JCC Count$^1q4 Curve In  Counterckw$^1D8 Wave Curve In  Counterckw$^1ISS Size$^1eSecond Digit: Amount of change (Inward or Outward).  COLUMNS$~DA VALUE BOX needs a position for the sign (+ or -) and a scalar (a to z, A to Z, or blank). The rest are digits.$^1MThe first box is for a number of 3 digits. The program makes it a positive integer (ABS and RND ACTIONs).$^1TThe second set of 10 boxes is for 5 digits, a sign, and a scalar.$^1|The third set of 100 boxes, MATRIX-A, is for a 10 by 10 matrix. Each box is for 4 digits, a sign, and a scalar.$^1NThe program calculates MATRIX-B as the inverse of MATRIX-A. MATRIX-C is the product of MATRIX-A and MATRIX-B.$^1PWhen you change MATRIX-A, MATRIX-B will change.  Click on TEXT to go to the TEXT BOX examples.$^1_Below is a set of 200 boxes (10 rows of 20 boxes). In each box is a 4 digit random number changed to text.$^1SThe 200 text strings are placed in the SYSTEM SORT ARRAY. Then a SORT action is used on this array.$^1ZThe SORT action creates an INDEX LIST that can be used to build the sorted 200 boxes at the bottom.$^1ZWhen you change one of the text boxes, the sort will be done again.$^1zClick on RETURN to go back to the HOME page.$^2@NThe PATL action can be used to create lines. The DOT LIST for a line can be used to create a ROAD.$^1[On the top left is a ROAD with 6 GIVEN PICTURES in a PLAY LIST.$^2>=On the top right is a ROAD with 4 GIVEN PATTERNS in a PLAY LIST.$^2=}On the bottom right is a ROAD with a VECTOR POLYGON in a PLAY LIST.$^1zThe 24 directions for the PATL lines are shown on the bottom left.$^1{To view PATL line examples, click on the box at the lower left.$^2>>First: Click on the DEALERS UP CARD value (1 to 10).$^2>GSecond: Enter the number of cards left in the deck for each card value.$^1vIt will finish the game 10,000 times and record the results.$^2>@The probability for each total (17 to OVER) will be shown.$^2B>A color is to be selected for each of the 4 canvases. All 8 digits. Dual colors. Transparency.$^1_Click on a digit for each of the 8 color options for each of the 4 canvases.$^1qThere is a sub-canvas for canvases 2, 3, and 4. The top has rectangles the bottom has blobs.$^1aThe selected digits are marked with a blue rectangle. 8 digits for each canvas.$~DHTML data can be placed on the Web Page.$^2>TMovies, pictures, and sounds can be imported from all over the WEB.$^1zThe Heading can be changed. The Red Stripe can be removed.$^2>BText can be placed on the Web Page. It can include links, tables, and more.$^2AoBefore making changes to an APP, you should save it. Click Save the Application. Click a letter (A thru T).$^1RLater, you can retrieve the saved APP by clicking on the file$2s letter at START APP on the APP Screen.$^1WIf you have made changes to an APP, be sure to save it before you close the browser.$^1iYou can also save an APP as an HTML Web Page by saving it to the Letter U. It will be placed in PAGE61.$^1YThen click PAD WRITE. Copy all of the text and place it in NOTEPAD. Then save it to filename.htm.$^1 To run it, enter file:///C";
